import React from 'react';
import YogaForm from './YogaForm'; // Import the YogaForm component
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* Remove the logo */}
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      {/* Add the YogaForm component here */}
      <YogaForm />
    </div>
  );
}

export default App;
